                    <font size="4" color="#4CAF50"><b>Mục tiêu</b></font> <br> Dự án của chúng tôi được thực hiện nhằm xác định ảnh hưởng tâm lý của việc chuyển đổi màu sắc đến tâm trạng người nhìn. <br>Đã bao giờ bạn phân vân về màu sắc khi chọn quần áo để thu hút mọi người? Kết quả của dự án này có thể cho bạn câu trả lời. <br><br>
                    <font size="4" color="#4CAF50"><b>Thế nào là chuyển đổi màu sắc?</b></font><br> Đó là khi bạn nhìn thấy một màu dần mờ nhạt dần, và bị thay thế dần bởi một màu sắc khác. Giống như khi bạn xem phim, ca nhạc, đèn nhiều màu được sử dụng để cho bạn những cảm giác khác nhau như vui vẻ, hồi hộp, căng thẳng... <br><br>
                    <font size="4" color="#4CAF50"><b>Các bước thí nghiệm</b></font> Thí nghiệm gồm 2 phần:<br>  
                    - <b>Phần 1: Kiểm tra màn hình và thị lực (Screen and Vision assessment)</b>: bạn chỉ cần trả lời một số câu hỏi ngắn dựa vào những màu sắc bạn nhìn thấy trên màn hình. Nếu cần thiết, hãy điều chỉnh góc nhìn, độ sáng và chất lượng màn hình đến khi bạn cảm thấy màu sắc hiển thị tự nhiên nhất.<br>
                    - <b>Phần 2: Thí nghiệm chuyển đổi màu sắc (Color transition experiment)</b>: bạn sẽ được xem một số mẫu chuyển đổi màu sắc và hãy cho tôi biết bạn có thích chúng hay không. Chi tiết thí nghiệm sẽ được trình bày ở phần sau.  
                        <br><img style="width: 45vw; display: inline-block" src="data:image/png;base64," alt="3 steps"><br>                                
                     <font size="4" color="#4CAF50"><b>Gợi ý:</b></font>  để quan sát màu sắc đẹp nhất xin vui lòng<br>
                    - Cố định vị trí hai mắt cách màn hình 60cm <br>
                    - Đặt mắt nhìn vuông góc với màn hình mặc chếch xuống phía dưới khoảng 15 độ. 
